import React from 'react';

import './App.css';

import Card from './Card.js';

function HomePage() {

    //data
    const information = require('./information.json');
    const imgSourse = require('/images/')
    const cards = information.map((item) => 
      <Card key={item.id} title={item.title} channelName = {item.channelName} views = {item.views} />
      )


  //render
    return (
 <body>
    <div id="root">
        <div className="HomePage">
        <header className="HomePage-header">Home Page
        </header>
             <div class="container">
                <section className="grid">
                    {cards}
                </section>
            </div>
        </div>
    </div>
</body>
    );
  }

  export default HomePage;
